                    </Link>
                </Jumbotron>
                */}

                <Row className="show-grid text-center">
                <Col xs={12} sm={4} >
                <Gage keyVal={'SPEED'} name={'MPH'} minVal={0} maxVal={140} />
                </Col>
                    <Col xs={12} sm={4} >
                 <Gage keyVal={'RPM'} name={'RPM'} minVal={0} maxVal={8000} />  
                </Col>
                <Col xs={12} sm={4} >
                <Gage keyVal={'THROTTLE_POS'} name={'Throttle %'} minVal={0} maxVal={240} /> 

                </Col>
                </Row>


            </Grid>
        )
    }
}
